export const Navbar = () => {
  return (
    <nav className="p-4 bg-purple-700 text-white flex justify-around">
      <Link to="/">Home</Link>
      <Link to="/about">About</Link>
      <Link to="/contact">Contact</Link>
    </nav>
  );
};
